import React, { useEffect, useState } from 'react';
import { fetchCarsByUser } from '../services/api';

const CarList = ({ userId }) => {
    const [cars, setCars] = useState([]);

    useEffect(() => {
        const getCars = async () => {
            try {
                const response = await fetchCarsByUser(userId);
                setCars(response.data);
            } catch (error) {
                console.error(error);
            }
        };
        getCars();
    }, [userId]);

    return (
        <div>
            <h1>Your Cars</h1>
            <ul>
                {cars.map((car) => (
                    <li key={car.id}>
                        <h3>{car.title}</h3>
                        <p>{car.description}</p>
                        <p>Tags: {car.tags}</p>
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default CarList;
